public class Continueloopstatement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i =0; i<=25; i++) {
			if (i==24 || i==23|| i==21)
			{
				continue;
			}
			System.out.println("print the non missing number based on "+i);
		}
	}

	}


